import React, { Component } from 'react';
import './Menu.css';
import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Button from 'react-bootstrap/Button';

class Menu extends Component {

  constructor(props) {
    super(props);
    this.state = {option : ''};
    
  }

  render() {
    return(
      <div>
        <ButtonGroup 
          className="ButtonGroup">
          <Button>Login</Button>
          <Button>Register</Button>
          <Button>Admin</Button>
        </ButtonGroup>
      </div>
    );
  }

}

export default Menu;
